// src/dashboard/Dashboard.jsx
import React from 'react';
import './Dashboard.css';  // We'll add some styles later

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <h1>Dashboard</h1>
      <div className="dashboard-content">
        <div className="card">
          <h2>Profile</h2>
          <p>View and edit your profile details.</p>
        </div>
        <div className="card">
          <h2>Settings</h2>
          <p>Manage your account settings and preferences.</p>
        </div>
        <div className="card">
          <h2>Reports</h2>
          <p>Access your reports and analytics.</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
